import React, { lazy, Suspense } from 'react';
import Header from './components/Header/Header'
const Footer = lazy(()=> import ('./components/Footer/Footer'))
const ContentFirstSection = lazy(()=>import('./components/Content/firstSection/ContentFirstSection'))
const ContentSecondSection = lazy(()=>import('./components/Content/secondSection/ContentSecontSection'))
const App = () => {
  return (
    <div>
      <Header/>
      <Suspense fallback={<h1>Still Loadingâ€¦</h1>}>
        <ContentFirstSection/>
        <ContentSecondSection/>
        </Suspense>
      <Footer/>
    </div>
  );
}

export default App;
